<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>3D Procedural Path - Grace Test</title>
    <!-- ADDITION: Importing Roboto Mono from Google Fonts -->
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Roboto+Mono:wght@700&display=swap" rel="stylesheet">
    <style>
        body {
            margin: 0;
            overflow: hidden;
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
            background-color: #111;
            color: white;
        }
        canvas {
            display: block;
        }
        /* ADDITION: Pink screen flash overlay */
        #flash-overlay {
            position: absolute;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            background-color: #ff00ff; /* Pink color */
            opacity: 0;
            pointer-events: none;
            z-index: 9999;
            transition: opacity 0.2s ease-in;
        }
        #info-panel {
            position: absolute;
            top: 20px;
            left: 20px;
            padding: 15px 20px;
            background-color: rgba(0, 0, 0, 0.8); /* Opaque black background */
            border-radius: 0px; /* Un-rounded corners */
            border: none; /* No outline */
            z-index: 10;
            transition: opacity 0.5s ease-out, visibility 0.5s ease-out; /* Fade out transition */
            opacity: 1;
            visibility: visible;
        }
        #info-panel h1 {
            margin: 0 0 10px 0;
            font-size: 1.2em;
        }
        #info-panel p {
            margin: 5px 0;
            font-size: 0.9em;
        }
        #crosshair {
            position: absolute;
            top: 50%;
            left: 50%;
            width: 4px;
            height: 4px;
            background-color: rgba(255, 255, 255, 0.7);
            border-radius: 50%;
            transform: translate(-50%, -50%);
            pointer-events: none; 
            display: none;
        }
        #log-container {
            position: absolute;
            top: 20px;
            right: 20px;
            width: 400px;
            max-height: 150px;
            overflow-y: scroll;
            background-color: rgba(0, 0, 0, 0.5);
            border-radius: 8px;
            padding: 10px;
            font-size: 0.8em;
            font-family: 'Courier New', Courier, monospace;
            z-index: 10;
        }
        #progress-tracker {
            position: absolute;
            top: 190px; 
            right: 20px;
            padding: 10px 15px;
            background-color: rgba(0, 0, 0, 0.5);
            border-radius: 8px;
            font-size: 0.9em;
            font-family: 'Courier New', Courier, monospace;
            z-index: 10;
        }
        #Carnation-distance-tracker {
            position: absolute;
            top: 250px; /* Positioned below the progress tracker */
            right: 20px;
            padding: 10px 15px;
            background-color: rgba(0, 0, 0, 0.5);
            border-radius: 8px;
            font-size: 0.9em;
            font-family: 'Courier New', Courier, monospace;
            z-index: 10;
        }
        #timer-panel {
            position: absolute;
            bottom: 20px;
            left: 20px;
            padding: 10px 15px;
            background-color: black;
            color: white;
            font-family: 'Roboto Mono', monospace;
            font-size: 2.4em;
            font-weight: bold;
            display: none; /* Hidden by default */
            z-index: 10;
            /* ADDITION: Smooth transition for shake effect */
            transition: transform 0.1s linear, color 0.3s ease-in-out;
        }
        #fake-timer-panel {
            position: absolute;
            bottom: 20px;
            left: 20px;
            padding: 10px 15px;
            background-color: black;
            color: black; 
            font-family: 'Roboto Mono', monospace;
            font-size: 2.4em;
            font-weight: bold;
            display: none; 
            z-index: 11; 
            animation-duration: 0.3s;
            animation-name: blink;
            animation-iteration-count: infinite;
            animation-play-state: paused;
            /* ADDITION: Smooth transition for shake effect */
            transition: transform 0.1s linear;
        }
        @keyframes blink {
            0%, 49% {
                opacity: 1; 
            }
            50%, 100% {
                opacity: 0; 
            }
        }
        .log-error {
            color: #ff8a80;
        }
        #coords-panel {
            position: absolute;
            bottom: 20px;
            right: 20px;
            padding: 10px 15px;
            background-color: rgba(0, 0, 0, 0.5);
            border-radius: 8px;
            font-size: 0.9em;
            font-family: 'Courier New', Courier, monospace;
        }

        /* ADDITION: Wall jump indicator styles */
        #walljump-indicator {
            position: absolute;
            top: calc(50% + 30px); /* Positioned below the crosshair */
            left: 50%;
            transform: translateX(-50%);
            font-family: 'Times New Roman', Times, serif;
            color: white;
            font-size: 1em; /* MODIFICATION: Reduced font size */
            font-weight: normal; /* MODIFICATION: Removed bolding */
            pointer-events: none;
            display: none; /* Hidden by default */
            transition: opacity 0.2s ease-in-out;
            text-shadow: 0 0 5px rgba(0,0,0,0.7);
        }

        /* ADDITION: Class to hide dev UI elements by default */
        .dev-ui {
            display: none;
        }

        /* ADDITION: Death Screen styles */
        #death-screen {
            position: absolute;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            background-color: black;
            z-index: 10000;
            display: none; /* Hidden by default */
            justify-content: center;
            align-items: center;
            overflow: hidden;
        }

        #death-flash-overlay {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background-color: black;
            opacity: 0;
            z-index: 10001; /* Above the death screen, below the message */
        }

        #death-message {
            color: white;
            font-family: 'PMingLiU-ExtB', 'Georgia', serif;
            font-size: 14px;
            text-align: center;
            z-index: 10002;
            opacity: 0;
            transform-origin: center center; /* Center the rotation */
            /* Floating animation is now handled by JavaScript */
        }

        /* ADDITION: Styles for multi-line death message */
        .death-message-line {
             color: white;
            font-family: 'PMingLiU-ExtB', 'Georgia', serif;
            font-size: 14px;
            text-align: center;
            z-index: 10002;
            opacity: 0;
            transform-origin: center center;
            font-weight: normal; /* Ensure text is not bold */
            margin: 4px 0;
        }

        /* ADDITION: Pink vignette overlay */
        #vignette-overlay {
            position: absolute;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            /* MODIFICATION: Tighter gradient and more opaque color for a more intense effect */
            background: radial-gradient(ellipse at center, rgba(255, 0, 255, 0) 55%, rgba(255, 0, 255, 0.75) 100%);
            pointer-events: none;
            z-index: 9998; /* Below flash overlay */
            opacity: 0;
            /* MODIFICATION: Removed transition for instantaneous updates */
        }

        @keyframes float-in {
            0% {
                opacity: 0;
                transform: translateY(30px);
            }
            25% {
                opacity: 1;
                transform: translateY(0px);
            }
            100% {
                opacity: 1;
                transform: translateY(0px);
            }
        }

        /* ADDITION: Carnation warning text styles */
        #carnation-warning-text {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            /* MODIFICATION: Changed font to match death screen */
            font-family: 'PMingLiU-ExtB', 'Georgia', serif;
            font-size: 15vw; /* MODIFICATION: Increased font size */
            /* MODIFICATION: Removed bold font weight */
            color: #ff00ff;
            text-align: center;
            pointer-events: none;
            z-index: 10000;
            display: none;
            /* MODIFICATION: Removed glow effect */
            line-height: 1;
        }

        /* REMOVED: CSS blinking animation is no longer needed */

        /* ADDITION: GIF overlay styles */
        #gif-overlay-container {
            position: absolute;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            pointer-events: none;
            z-index: 1000; /* Below UI but above the game canvas */
            overflow: hidden;
        }

        .music-gif {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            object-fit: cover; /* Stretches GIF to fill screen */
            display: none; /* Hidden by default */
        }

    </style>
</head>

        import * as CANNON from 'cannon-es';
        import { PointerLockControls } from 'three/addons/controls/PointerLockControls.js';
        import { OBJLoader } from 'three/addons/loaders/OBJLoader.js';
        import { MTLLoader } from 'three/addons/loaders/MTLLoader.js';

        // --- Basic Setup ---
        let scene, camera, renderer, controls, world;
        let loadedModel = null;
        let woodDoorTemplate, metalDoorTemplate, CarnationTemplate; // ADDITION: CarnationTemplate
        const clock = new THREE.Clock();
        let flashlight, saferoomLight, lanternLight, mainAmbientLight;
        let wallContactDebugArrow;
        let activeLight = 'flashlight';
        let isCurrentlyInSaferoom = false;
        const doors = [];
        let models = [];
        const mapSegments = [];
        let footstepsSound;
        let isDevUiVisible = false; // ADDITION: For toggling dev UI
        let isFirstLock = true; // For starting ambient sounds on first click
        let skyPlaneWireframe, skyPlane; // MODIFICATION: Added skyPlane for global access
        let windStreaks; // ADDITION: For wind streak particles
        let skyVideoTexture; // ADDITION: Make video texture globally accessible for updates
        
        // --- Carnation variables ---
        let Carnation = null;
        let CarnationPath = [];
        let CarnationPathIndex = 0;
        const Carnation_SPAWN_OFFSET = new THREE.Vector3(0, 2, 0); 
        const Carnation_MOVE_SPEED = 30; // MODIFICATION: Carnation is now 2x faster
        const Carnation_TARGET_OFFSET = new THREE.Vector3(0, 2, 0);
        let doorsOpenedThisLevel = 0;
        let CarnationSpawnThreshold = 0;
        let saferoomsCompleted = 0;

        // --- MODIFICATION: Added new music track to the list ---
        const musicTracks = ['ULTRASONICFAITH', 'SILENCEISALIE', 'MISSING'];
        let currentMusicTrack = null;

        // --- ADDITION: Carnation proximity sound ---
        let carnationLoopSound;
        // --- ADDITION: Player speed wind sound ---
        let windSound;

        // --- ADDITION: GIF overlay logic ---
        let ultrasonicFaithLoop = null;
        let nextGifEventIndex = 0;
        const ultrasonicFaithSchedule = [
            { time: 95, action: 'show', targets: ['gif-1'] },
            { time: 98, action: 'show', targets: ['gif-2'] },
            { time: 101, action: 'hide', targets: ['gif-1', 'gif-2'] },
            { time: 101.1, action: 'show', targets: ['gif-3'] }, // Slight offset for sequential events
            { time: 102, action: 'show', targets: ['gif-4'] },
            { time: 104, action: 'hide', targets: ['gif-3', 'gif-4'] },
            { time: 104.1, action: 'show', targets: ['gif-5'] },
            { time: 108, action: 'show', targets: ['gif-5'] },
            { time: 108, action: 'show', targets: ['gif-6'] },
            { time: 110, action: 'show', targets: ['gif-7'] },
            { time: 113, action: 'hide', targets: ['gif-6', 'gif-7'] },
            { time: 113.1, action: 'show', targets: ['gif-8'] },
            { time: 115, action: 'show', targets: ['gif-9'] },
            { time: 116.5, action: 'hide', targets: ['gif-8', 'gif-9'] },
            { time: 116.6, action: 'show', targets: ['gif-10'] },
            { time: 120, action: 'hide', targets: ['gif-10'] }
        ];

        // --- ADDITION: Music fade-out interval ---
        let musicFadeInterval = null;

        // --- Footstep sound interval variables ---
        let footstepTimeout = null;
        let isMakingFootstepSounds = false;
        const FOOTSTEP_INTENSITY = 1; 
        const FOOTSTEP_PITCH_VARIATION = 0.5; 
        const footstepPool = [];
        let footstepPoolIndex = 0;
        const FOOTSTEP_POOL_SIZE = 20;

        // ADDITION: Player death state
        let isPlayerDead = false;


        // --- Progressive Difficulty & Timer ---
        let currentRoomCount = 10;
        const roomIncrement = 30;
        const maxRoomCount = 120;
        let gameTimer;
        let timerInterval;
        const initialTime = 150; 

        // --- Grace period and CCD boost variables ---
        let saferoomGracePeriod = false;
        let isCcdBoosted = false;
        let ccdBoostTimeout = null;
        let saferoomDoorBlocker = null;

        // --- Physics ---
        let playerBody;
        let canJump = false;
        let oldCanJump = false;
        const standingHeight = 1.8;
        const crouchingHeight = 1.0;
        let playerHeight = standingHeight;
        const playerMass = 70;
        const walkSpeed = 12;
        const sprintSpeed = 24;
        const crouchSpeed = 11;
        const jumpVelocity = 10.5;
        const inputVelocity = new THREE.Vector3();
        const euler = new THREE.Euler();

        // --- Movement Speed & State ---
        let isSprintToggled = false;
        const groundAcceleration = 80;
        const airAcceleration= 30.0;
        const maxWallJumps = 3;
        let wallJumpsAvailable = maxWallJumps;
        const wallJumpForce = 18;
        const wallJumpUpwardVelocity = 16;
        const wallJumpForwardMultiplier = 1;
        
        // --- Dynamic CCD settings ---
        const MIN_CCD_ITERATIONS = 5; 
        const MAX_CCD_ITERATIONS = 10;
        const CCD_SPEED_MIN = 12;
        const CCD_SPEED_MAX = 45;

        // --- Sliding & Crouching ---
        let isCrouching = false;
        let isSliding = false;
        let slideOnLand = false;
        let currentSlideSpeed = 0;
        let slideHeightCheckTimer = 0;
        let lastSlideYPosition = 0;
        const slideHeightCheckInterval = 0.1;
        const slideBoost = 25;
        const slideFriction = 0.999;
        const slideGravityFactor = 1.2;
        const slideExtraGravity = 40;
        const maxSlideSpeed = 32;

        // --- Door Physics ---
        const DOOR_OFFSET = new THREE.Vector3(0, 0, 2.1);
        const DOOR_BUST_DISTANCE = 4.0;
        const DOOR_BUST_FORCE = 80;
        const DOOR_SPEED_MULTIPLIER = 10;
        const DOOR_DESPAWN_Y = -200;
        const DOOR_RENDER_DISTANCE = 100; 
        const METAL_DOOR_TUMBLE_ROTATION_OFFSET = new THREE.Euler(Math.PI / 2, 0, 0); 
        const METAL_DOOR_TUMBLE_POSITION_OFFSET = new THREE.Vector3(0, -2, 1.5); 
        const PLAYER_COLLISION_GROUP = 1;
        const DOOR_COLLISION_GROUP = 2;


        // --- Camera Shake variables ---
        let eventShakeIntensity = 0;
        let eventShakeDuration = 0;
        let proximityShakeIntensity = 0;
        let shakeTime = 0;
        const Carnation_SHAKE_MAX_INTENSITY = 0.4;
        const Carnation_SHAKE_MIN_DISTANCE = 5;
        const Carnation_SHAKE_MAX_DISTANCE = 40;
        const WALL_JUMP_SHAKE_INTENSITY = 0.2;
        const WALL_JUMP_SHAKE_DURATION = 0.3;
        // MODIFICATION: Re-added constants for sprint shake
        const shakeIntensity = 0.2;
        const shakeSpeed = 20;


        //---end offset hitbox---
        const SAFEROOM_OFFSET = new THREE.Vector3(0, -20, 0);
        const SAFEROOM_SIZE   = new THREE.Vector3(10, 10, 10);
        const SPAWN_OFFSET = new THREE.Vector3(0, -20, -20);
        let saferoomBox = null;
        let saferoomExitDetails = {}; 
        let lastSaferoomExitDetails = {};
        let isFirstGeneration = true;

        // --- On-screen logger ---
        const logContainer = document.getElementById('log-container');
        function logToScreen(message, isError = false) {
            const logEntry = document.createElement('p');
            logEntry.textContent = `> ${message}`;
            if (isError) logEntry.classList.add('log-error');
            logContainer.appendChild(logEntry);
            logContainer.scrollTop = logContainer.scrollHeight;
        }
        console.log = (message) => logToScreen(message);
        console.error = (message) => logToScreen(message, true);
        
        // --- Functions for Carnation, footsteps, timer, and death ---
        function triggerCameraShake(intensity, duration) {
            eventShakeIntensity = Math.max(eventShakeIntensity, intensity);
            eventShakeDuration = Math.max(eventShakeDuration, duration);
        }

        function triggerScreenFlash() {
            const overlay = document.getElementById('flash-overlay');
            overlay.style.transition = 'opacity 0.2s ease-in';
            overlay.style.opacity = 1;

            setTimeout(() => {
                overlay.style.transition = 'opacity 0.5s ease-out';
                overlay.style.opacity = 0;
            }, 400); // 200ms ease-in + 200ms hold
        }

        function spawnCarnation() {
            logToScreen("A Carnation has appeared!");
            triggerScreenFlash();

            if (!saferoomBox || !lastSaferoomExitDetails.lastPosition) {
                console.error("Cannot spawn Carnation: previous saferoom exit details are missing.");
                return;
            }
            const spawnPoint = lastSaferoomExitDetails.lastExitConnectorPos.clone()
                .applyEuler(lastSaferoomExitDetails.lastRotation)
                .add(lastSaferoomExitDetails.lastPosition);

            // MODIFICATION: Replace the placeholder cube with the loaded Carnation model
            if (!CarnationTemplate) {
                console.error("Carnation template not loaded! Spawning a pink cube as a fallback.");
                const CarnationGeometry = new THREE.BoxGeometry(4, 4, 4);
                const CarnationMaterial = new THREE.MeshBasicMaterial({ color: 0xff00ff });
                Carnation = new THREE.Mesh(CarnationGeometry, CarnationMaterial);
            } else {
                // MODIFICATION: Wrap the model in a group to handle rotation offset
                const CarnationModel = CarnationTemplate.clone();
                
                // --- ROTATION OFFSET ---
                // If your model is facing the wrong way, adjust the rotation here.
                // The value is in radians. Some common values:
                // Math.PI / 2  (90 degrees right)
                // -Math.PI / 2 (-90 degrees left)
                // Math.PI      (180 degrees)
                CarnationModel.rotation.y = Math.PI; // Example: Rotate 180 degrees
                
                const CarnationGroup = new THREE.Group();
                CarnationGroup.add(CarnationModel);
                
                // MODIFICATION: Replaced the white spotlight with a bright, long-range pink point light.
                const CarnationLight = new THREE.PointLight(0xff00ff, 8.0, 60); // color, intensity, distance
                CarnationGroup.add(CarnationLight);
                
                Carnation = CarnationGroup; // The 'Carnation' variable is now the group
                
                // We can adjust the scale of the Carnation here if needed
                Carnation.scale.set(0.5, 0.5, 0.5); 
            }
            
            CarnationPath = doors.map(door => door.mesh.position.clone().add(Carnation_TARGET_OFFSET));
            
            const finalDestination = saferoomBox.getCenter(new THREE.Vector3());
            CarnationPath.push(finalDestination);
            
            if (CarnationPath.length > 0) { 
                Carnation.position.copy(spawnPoint).add(Carnation_SPAWN_OFFSET);
                CarnationPathIndex = 0;
                scene.add(Carnation);
            } else {
                console.error("Cannot spawn Carnation: path is empty.");
                Carnation = null;
            }
        }
        
        function playFootstep() {
            const audio = footstepPool[footstepPoolIndex];
            
            if (audio && audio.readyState >= 2) {
                const horizontalSpeed = Math.sqrt(playerBody.velocity.x**2 + playerBody.velocity.z**2);
                const minPlaybackRate = 1.0;
                const maxPlaybackRate = 2.5;
                const speedForMaxRate = sprintSpeed; 
                let basePlaybackRate = minPlaybackRate + (maxPlaybackRate - minPlaybackRate) * (horizontalSpeed / speedForMaxRate);
                basePlaybackRate = Math.max(minPlaybackRate, Math.min(basePlaybackRate, maxPlaybackRate));

                const randomPitch = (Math.random() - 0.5) * 2 * FOOTSTEP_PITCH_VARIATION;
                audio.playbackRate = basePlaybackRate + randomPitch;
                
                audio.currentTime = 0;
                audio.play().catch(e => {});

                footstepPoolIndex = (footstepPoolIndex + 1) % FOOTSTEP_POOL_SIZE;
            }
        }

        function scheduleNextFootstep() {
            playFootstep();
            const horizontalSpeed = Math.sqrt(playerBody.velocity.x**2 + playerBody.velocity.z**2);
            const baseInterval = 5000; 
            let interval = baseInterval / (horizontalSpeed * FOOTSTEP_INTENSITY);
            interval = Math.max(150, Math.min(interval, 600)); 
            if (isMakingFootstepSounds) {
                footstepTimeout = setTimeout(scheduleNextFootstep, interval);
            }
        }

        // ADDITION: New function to fade out music dramatically
        function fadeOutMusic(duration) {
            if (musicFadeInterval) clearInterval(musicFadeInterval);
            
            const music = currentMusicTrack;
            if (!music || music.paused) {
                return;
            }

            const initialVolume = music.volume;
            const initialPlaybackRate = music.playbackRate;
            const steps = duration / 20; // Update every 20ms
            const volumeStep = initialVolume / steps;
            const playbackRateStep = (initialPlaybackRate - 0.1) / steps; // Slow down to near zero

            musicFadeInterval = setInterval(() => {
                if (music.volume > volumeStep) {
                    music.volume -= volumeStep;
                } else {
                    music.volume = 0;
                }

                if (music.playbackRate > playbackRateStep + 0.1) {
                    music.playbackRate -= playbackRateStep;
                } else {
                    music.playbackRate = 0.1;
                }

                if (music.volume <= 0) {
                    clearInterval(musicFadeInterval);
                    musicFadeInterval = null;
                    music.pause();
                    music.currentTime = 0;
                    music.volume = 0.3; // Reset for next time
                    music.playbackRate = 1.0;     // Reset for next time
                    currentMusicTrack = null;

                    // ADDITION: Stop GIF loop when music fades out
                    if (ultrasonicFaithLoop) {
                        cancelAnimationFrame(ultrasonicFaithLoop);
                        ultrasonicFaithLoop = null;
                        hideAllGifs();
                    }
                }
            }, 20);
        }

        function playerDeath(reason = "Time's up! You died.") {
            if (isPlayerDead) return; // Prevent death function from running multiple times
            isPlayerDead = true;

            // Stop all sounds
            fadeOutMusic(2000); // 2-second dramatic slow-down effect
            if (carnationLoopSound) carnationLoopSound.pause(); // Also stop Carnation's loop instantly
            if (windSound) windSound.pause(); // ADDITION: Stop wind sound on death
            isMakingFootstepSounds = false;
            clearTimeout(footstepTimeout);
            footstepTimeout = null;
            controls.unlock();

            logToScreen(reason);
            
            const deathScreen = document.getElementById('death-screen');
            const flashOverlay = document.getElementById('death-flash-overlay');
            const messageElements = [
                document.getElementById('death-message-1'),
                document.getElementById('death-message-2'),
                document.getElementById('death-message-3')
            ];

            // Set the death screen to be a flex container that centers its content
            deathScreen.style.display = 'flex';
            deathScreen.style.justifyContent = 'center';
            deathScreen.style.alignItems = 'center';


            // Hide other UI
            const uiElements = ['info-panel', 'log-container', 'progress-tracker', 'Carnation-distance-tracker', 'timer-panel', 'fake-timer-panel', 'crosshair', 'coords-panel'];
            uiElements.forEach(id => {
                const el = document.getElementById(id);
                if (el) el.style.display = 'none';
            });
            
            // MODIFICATION: Death quotes are now in sets
            const deathQuotes = [
                ["im no evil.", "follow the path ive threaded for you.", "i love you."],
                ["endure, so you can endure more.", "i embrace you, you would'nt be here if i didnt.", "im no evil."],
                ["im no evil.", "i threaded a path for you to follow.", "find the true happiness that you desire."]
            ];

            const selectedSet = deathQuotes[Math.floor(Math.random() * deathQuotes.length)];
            const visibleMessages = [];

            let startTime = null;
            function animateDeathText(currentTime) {
                if (isPlayerDead) { // Keep animating as long as the death screen is up
                    if (!startTime) startTime = currentTime;
                    const elapsedTime = currentTime - startTime;

                    const yOffset = Math.sin(elapsedTime / 600) * 8; 
                    const rotation = Math.cos(elapsedTime / 1200) * 1.5; 
                    
                    visibleMessages.forEach(el => {
                        el.style.transform = `translateY(${yOffset}px) rotate(${rotation}deg)`;
                    });

                    requestAnimationFrame(animateDeathText);
                }
            }

            const showMessageSequence = () => {
                flashOverlay.style.display = 'none'; // Hide the flash overlay
                
                requestAnimationFrame(animateDeathText); // Start the animation loop

                const revealLine = (index) => {
                    if (index >= selectedSet.length) {
                        // All lines revealed, start the 3-second pause
                        setTimeout(() => location.reload(), 3000);
                        return;
                    }

                    const el = messageElements[index];
                    el.textContent = selectedSet[index];
                    el.style.opacity = 1; // Appear instantly
                    visibleMessages.push(el);

                    // Wait 2 seconds before showing the next line
                    setTimeout(() => revealLine(index + 1), 2000);
                };
                
                revealLine(0); // Start the sequence
            };

            const flash = (count) => {
                if (count >= 4) {
                    // Stay black after last flash
                    flashOverlay.style.backgroundColor = 'black';
                    flashOverlay.style.opacity = 1;
                    // Wait 2 seconds before showing the message
                    setTimeout(showMessageSequence, 2000); 
                    return;
                }
                flashOverlay.style.backgroundColor = (count % 2 === 0) ? 'white' : 'black';
                flashOverlay.style.opacity = 1;
                setTimeout(() => flash(count + 1), 100); // 100ms per flash
            };

            flash(0); // Start the flashing sequence
        }

        function updateTimerDisplay() {
            if (gameTimer === undefined) return;
            const timerPanel = document.getElementById('timer-panel');
            const minutes = Math.floor(gameTimer / 60);
            const seconds = Math.floor(gameTimer % 60);
            const milliseconds = Math.floor((gameTimer * 100) % 100);
            timerPanel.textContent = 
                `${minutes}:${seconds.toString().padStart(2, '0')}.${milliseconds.toString().padStart(2, '0')}`;
        }

        function startNextLevelTimer() {
            logToScreen("Timer countdown started!");
            gameTimer = initialTime;
            
            const fakeTimerPanel = document.getElementById('fake-timer-panel');
            fakeTimerPanel.style.animationPlayState = 'paused';
            fakeTimerPanel.style.display = 'none';

            if (timerInterval) clearInterval(timerInterval);

            timerInterval = setInterval(() => {
                gameTimer -= 0.1;
                if (gameTimer <= 0) {
                    gameTimer = 0;
                    updateTimerDisplay();
                    clearInterval(timerInterval);
                    playerDeath();
                } else {
                    updateTimerDisplay();
                }
            }, 100);
            
            setTimeout(() => {
                saferoomGracePeriod = false;
            }, 100);
        }

        function enterSaferoom() {
            if (isCurrentlyInSaferoom) return;

            if (playerBody.velocity.y < -1) {
                playerBody.velocity.y *= 0.1;
                logToScreen("Fall speed dampened upon entering saferoom.");
            }

            isCurrentlyInSaferoom = true;
            if (saferoomLight) saferoomLight.visible = true;
            flashlight.visible = false;
            lanternLight.visible = false;
            scene.fog = null;
            mainAmbientLight.intensity = 1.0;
            mainAmbientLight.color.set(0xffffff);
            
            // MODIFICATION: Fade out the current music track instead of stopping it abruptly.
            fadeOutMusic(1500); // 1.5-second fade
            
            lastSaferoomExitDetails = { ...saferoomExitDetails };
            saferoomsCompleted++;
            document.getElementById('progress-tracker').textContent = `Saferooms Cleared: ${saferoomsCompleted}`;
            doorsOpenedThisLevel = 0;
            CarnationSpawnThreshold = Math.floor(Math.random() * 5) + 3;
            logToScreen(`Carnation will spawn after ${CarnationSpawnThreshold} doors in the next level.`);

            if (Carnation) {
                if(carnationLoopSound) carnationLoopSound.pause(); // Stop Carnation sound
                scene.remove(Carnation);
                Carnation = null;
            }


            logToScreen("Saferoom entered. Boosting collision detection for 8 seconds.");
            isCcdBoosted = true;
            playerBody.ccdIterations = 18;

            if (ccdBoostTimeout) clearTimeout(ccdBoostTimeout);

            ccdBoostTimeout = setTimeout(() => {
                logToScreen("CCD boost expired.");
                isCcdBoosted = false;
            }, 8000);


            if (timerInterval) {
                clearInterval(timerInterval);
                timerInterval = null;
                
                const timerPanel = document.getElementById('timer-panel');
                const fakeTimerPanel = document.getElementById('fake-timer-panel');
                
                timerPanel.textContent = "YouRe SaFE";
                timerPanel.style.color = 'lime';
                
                fakeTimerPanel.style.display = 'none';
                fakeTimerPanel.style.animationPlayState = 'paused';

                logToScreen("Saferoom reached! Timer stopped.");
                currentRoomCount = Math.min(currentRoomCount + roomIncrement, maxRoomCount);
                logToScreen(`Next section will have ${currentRoomCount} rooms.`);
            }
        }

        function exitSaferoom() {
            if (!isCurrentlyInSaferoom) return;

            isCcdBoosted = false;

                clearTimeout(ccdBoostTimeout);
