                const startRoom = generatedPath.getObjectByName('Start');
                if (startRoom) {
                    const box = new THREE.Box3().setFromObject(startRoom);
                    const center = box.getCenter(new THREE.Vector3());
                    playerBody.position.set(center.x, box.max.y + playerHeight, center.z);
                    playerBody.position.vadd(SPAWN_OFFSET, playerBody.position);
                    logToScreen("Player spawned on top of Start room.");
                    controls.getObject().rotation.y = Math.PI;
                } else {
                    playerBody.position.set(0, 10, 15);
                    console.error("Start room not found, spawning at default location.");
                }
            } catch (error) {
                console.error(`Generation failed (this is expected if models are empty): ${error.message}`);
                playerBody.position.set(0, 5, 0);
            }

            window.addEventListener('resize', onWindowResize, false);
            document.addEventListener('keydown', onKeyDown);
            document.addEventListener('keyup', onKeyUp);
            animate();
        }

        function createRoomTemplate(modelDef) {
            const mtlLoader = new MTLLoader();
            const objLoader = new OBJLoader();
            const materials = mtlLoader.parse(modelDef.mtldata, '');

            // --- DEBUGGING ADDITION START ---
            console.log(`Loading materials for ${modelDef.name}:`, materials.materials); 
        
            // This is a great debugging step. It tells the renderer to draw both the
            // front and back of your model's faces. If the texture suddenly appears
            // on the INSIDE of your Carnation, it means the faces are flipped inside-out,
            // a setting you'll need to fix in Vectary ("Recalculate Normals").
            Object.values(materials.materials).forEach(material => {
                material.side = THREE.DoubleSide; 
                
                // Let's also check if the texture map is actually loaded on the material object
                if(material.name === 'Nepal') {
                    console.log("Found 'Nepal' material. Texture map object:", material.map);
                    // If the .map property is null here, the texture URL is likely wrong or couldn't be loaded.
                }
            });
            // --- DEBUGGING ADDITION END ---

            materials.preload();
            objLoader.setMaterials(materials);
            const model = objLoader.parse(modelDef.objdata);
            const box = new THREE.Box3().setFromObject(model);
            const center = box.getCenter(new THREE.Vector3());
            const templateWrapper = new THREE.Object3D();
            model.position.sub(center);
            templateWrapper.add(model);
            const scaleFactor = (3 / 50) * 1.1;
            templateWrapper.scale.set(scaleFactor, scaleFactor, scaleFactor);
            templateWrapper.updateMatrixWorld(true);
            return templateWrapper;
        }

        function generateRandomPath(allModels, numberOfRooms, continueFromSaferoom = false) {
             if (!continueFromSaferoom && (allModels.length === 0 || !allModels.find(m => m.name === "Start"))) {
                 throw new Error("Initial model data is empty or 'Start' model is missing.");
            }
            logToScreen(`Generating random path with ${numberOfRooms} rooms...`);
            const finalGroup = new THREE.Group();
            
            let lastPosition, lastRotation, lastExitConnectorPos, currentPathRotation;

            if (continueFromSaferoom) {
                lastPosition = saferoomExitDetails.lastPosition.clone();
                lastRotation = saferoomExitDetails.lastRotation.clone();
                lastExitConnectorPos = saferoomExitDetails.lastExitConnectorPos.clone();
                currentPathRotation = saferoomExitDetails.currentPathRotation;
            } else {
                lastPosition = new THREE.Vector3();
                lastRotation = new THREE.Euler();
                lastExitConnectorPos = null;
                currentPathRotation = 0;
            }

            for (let i = 0; i < numberOfRooms; i++) {
                let randomModelDef = null;
                if (i === 0 && isFirstGeneration && !continueFromSaferoom) {
                    randomModelDef = allModels.find(m => m.name === "Start");
                } else if (i === numberOfRooms - 1) {
                    randomModelDef = allModels.find(m => m.name === "End");
                } else {
                    const validModels = allModels.filter(model => model.isActive && Math.abs(currentPathRotation + model.OutRotation) <= 95);
                    if (validModels.length > 0) {
                        const totalWeight = validModels.reduce((sum, model) => sum + model.weight, 0);
                        let randomThreshold = Math.random() * totalWeight;
                        for (const model of validModels) {
                            if (randomThreshold < model.weight) { randomModelDef = model; break; }
                            randomThreshold -= model.weight;
                        }
                    } else {
                        randomModelDef = allModels.find(m => m.OutRotation === 0 && m.isActive) || allModels[0];
                    }
                }
                if (!randomModelDef) continue;
                
                const roomTemplate = createRoomTemplate(randomModelDef);
                const connectorColors = { '8B4513': 'color_9127187', 'FAFAFA': 'color_16448250' };
                const connectors = [];
                roomTemplate.traverse(child => {
                    if (child.isMesh && (child.material.name === connectorColors['8B4513'] || child.material.name === connectorColors['FAFAFA'])) {
                        const center = new THREE.Vector3();
                        child.geometry.computeBoundingBox();
                        child.geometry.boundingBox.getCenter(center);
                        child.localToWorld(center);
                        connectors.push({ position: center.clone(), materialName: child.material.name });
                    }
                });
                const entryConnector = connectors.find(c => c.materialName === connectorColors['8B4513']);
                const exitConnector = connectors.find(c => c.materialName === connectorColors['FAFAFA']);
                if (!entryConnector || !exitConnector) { console.error(`Skipping piece, connectors not found for: ${randomModelDef.name}`); continue; }
                
                const currentInstanceRotation = new THREE.Euler(-Math.PI / 2, 0, THREE.MathUtils.degToRad(currentPathRotation), 'XYZ');
                let currentPosition = new THREE.Vector3();
                if (i > 0 || continueFromSaferoom) {
                    const lastExitPointWorld = lastExitConnectorPos.clone().applyEuler(lastRotation).add(lastPosition);
                    const currentEntryOffset = entryConnector.position.clone().applyEuler(currentInstanceRotation);
                    currentPosition = lastExitPointWorld.sub(currentEntryOffset);
                }
                const roomInstance = roomTemplate;
                roomInstance.position.copy(currentPosition);
                roomInstance.rotation.copy(currentInstanceRotation);
                roomInstance.name = randomModelDef.name;
                finalGroup.add(roomInstance);
                
                if(exitConnector && i < numberOfRooms - 1) {
                    const nextPathRotation = currentPathRotation + randomModelDef.OutRotation;
                    const nextInstanceRotation = new THREE.Euler(-Math.PI / 2, 0, THREE.MathUtils.degToRad(nextPathRotation), 'XYZ');
                    const doorMesh = woodDoorTemplate.clone();
                    const exitPosWorld = exitConnector.position.clone().applyEuler(currentInstanceRotation).add(currentPosition);
                    doorMesh.position.copy(exitPosWorld);
                    doorMesh.quaternion.setFromEuler(nextInstanceRotation);
                    const localOffset = DOOR_OFFSET.clone().applyQuaternion(doorMesh.quaternion);
                    doorMesh.position.add(localOffset);
                    scene.add(doorMesh);
                    doors.push({ mesh: doorMesh, isBusted: false, body: null, type: 'wood' });
                }

                lastPosition.copy(currentPosition);
                lastRotation.copy(currentInstanceRotation);
                lastExitConnectorPos = exitConnector.position.clone();
                currentPathRotation += randomModelDef.OutRotation;
                
                if (randomModelDef.name === "End") {
                    const bbox = new THREE.Box3().setFromObject(roomInstance);
                    const center = new THREE.Vector3();
                    bbox.getCenter(center);
                    center.add(SAFEROOM_OFFSET);
                    const half = SAFEROOM_SIZE.clone().multiplyScalar(0.5);
                    saferoomBox = new THREE.Box3(center.clone().sub(half), center.clone().add(half));
                    
                    saferoomLight = new THREE.PointLight(0xffffff, 5.0, 100);
                    saferoomLight.position.copy(saferoomBox.getCenter(new THREE.Vector3()));
                    saferoomLight.visible = false;
                    scene.add(saferoomLight);

                    if (exitConnector) {
                        const metalDoorMesh = metalDoorTemplate.clone();
                        const exitPosWorld = exitConnector.position.clone().applyEuler(currentInstanceRotation).add(currentPosition);
                        
                        metalDoorMesh.position.copy(exitPosWorld);
                        metalDoorMesh.quaternion.setFromEuler(currentInstanceRotation);
                        
                        const localOffset = DOOR_OFFSET.clone().applyQuaternion(metalDoorMesh.quaternion);
                        metalDoorMesh.position.add(localOffset);
                        
                        doors.push({ 
                            mesh: metalDoorMesh, 
                            isOpening: false,
                            isOpen: false,
                            targetPosition: null, 
                            targetRotation: null, 
                            animationProgress: 0, 
                            type: 'metal'
                        });
                        scene.add(metalDoorMesh);

                        saferoomExitDetails = {
                            lastPosition: currentPosition,
                            lastRotation: currentInstanceRotation,
                            lastExitConnectorPos: exitConnector.position.clone(),
                            currentPathRotation: currentPathRotation
                        };
                    }
                }
            }
            if (!continueFromSaferoom) {
                isFirstGeneration = false;
            }
            return finalGroup;
        }

        function createStaticCollisionBodies(group) {
            logToScreen("Creating detailed collision geometry for map...");
            const physicsBodies = []; 
            group.traverse(child => {
                if (child.isMesh) {
                    if (child.material.name === 'color_9127187' || child.material.name === 'color_16448250') return;
                    
                    const geometry = child.geometry;
                    const posAttr = geometry.attributes.position;
                    if (!posAttr || posAttr.count === 0) return;
                    
                    const vertices = posAttr.array;
                    let indices;

                    if (geometry.index) {
                        indices = geometry.index.array;
                    } else {
                        logToScreen(`Generating indices for mesh part.`);
                        indices = new Array(posAttr.count);
                        for (let i = 0; i < posAttr.count; i++) {
                            indices[i] = i;
                        }
                    }

                    if (!indices || indices.length === 0) {
                         console.error("Failed to get or generate indices for a mesh part.");
                         return;
                    }
                    
                    const transformedVertices = [];
                    const vec3 = new THREE.Vector3();
                    for (let i = 0; i < vertices.length; i += 3) {
                        vec3.set(vertices[i], vertices[i+1], vertices[i+2]);
                        vec3.applyMatrix4(child.matrixWorld);
                        transformedVertices.push(vec3.x, vec3.y, vec3.z);
                    }

                    const shape = new CANNON.Trimesh(transformedVertices, indices);
                    const body = new CANNON.Body({ mass: 0 });
                    
                    body.addShape(shape);
                    body.position.set(0, 0, 0);
                    body.quaternion.set(0, 0, 0, 1);
                    world.addBody(body);
                    physicsBodies.push(body); 
                }
            });
            logToScreen("Detailed collision geometry created.");
            return physicsBodies; 
        }

        function updateGroundedState() {
            canJump = false; 
            for (const contact of world.contacts) {
                let normal = new CANNON.Vec3();
                let playerBodyIndex = -1;

                if (contact.bi === playerBody) {
                    playerBodyIndex = 0;
                } else if (contact.bj === playerBody) {
                    playerBodyIndex = 1;
                }

                if (playerBodyIndex !== -1) {
                    if (playerBodyIndex === 0) {
                        contact.ni.negate(normal);
                    } else {
                        normal.copy(contact.ni);
                    }
                    
                    if (normal.dot(new CANNON.Vec3(0, 1, 0)) > 0.3) {
                        canJump = true;
                        break;
                    }
                }
            }
        }
  
        function onWindowResize() {
            camera.aspect = window.innerWidth / window.innerHeight;
            camera.updateProjectionMatrix();
            renderer.setSize(window.innerWidth, window.innerHeight);
        }

        const keyStates = {};
        function onKeyUp(event) {
            keyStates[event.code] = false;
        }

        function onKeyDown(event) {
            keyStates[event.code] = true;

            if (event.code === 'Space') {
                if (canJump && controls.isLocked) {
                    if (isSliding) {
                        isSliding = false;
                        isCrouching = false;
                        slideOnLand = false;
                        playerBody.shapeOffsets[1].set(0, 0.35, 0);
                    }
                    const impulse = new CANNON.Vec3(0, jumpVelocity * playerMass, 0);
                    playerBody.applyImpulse(impulse);
                    canJump = false;
                } else if (wallJumpsAvailable > 0 && !canJump && controls.isLocked) {
                    attemptWallJump();
                }
            }

            if (event.code === 'ShiftLeft' || event.code === 'ShiftRight' || event.code === 'KeyR') {
                if (controls.isLocked && !isCrouching) isSprintToggled = !isSprintToggled;
            }
            if (event.code === 'Digit1' && controls.isLocked) {
                activeLight = 'flashlight';
                flashlight.visible = true;
                lanternLight.visible = false;
            }
            if (event.code === 'Digit2' && controls.isLocked) {
                activeLight = 'lantern';
                flashlight.visible = false;
                lanternLight.visible = true;
            }

            // ADDITION: 'i' key to toggle dev UI
            if (event.code === 'KeyI') {
                isDevUiVisible = !isDevUiVisible;
                const devElements = document.querySelectorAll('.dev-ui');
                devElements.forEach(el => {
                    el.style.display = isDevUiVisible ? 'block' : 'none';
                });
                // ADDITION: Also toggle the skybox wireframe visibility
                if (skyPlaneWireframe) {
                    skyPlaneWireframe.visible = isDevUiVisible;
                }
            }

            // ADDITION: 'h' key to toggle fog for debugging
            if (event.code === 'KeyH') {
                if (scene.fog) {
                    scene.fog = null;
                    logToScreen("Fog disabled.");
                } else {
                    scene.fog = new THREE.Fog(0x0a101a, 20, 90);
                    logToScreen("Fog enabled.");
                }
            }
        }
        
        function updatePlayer(delta) {
            if (!controls.isLocked) {
                playerBody.velocity.x = 0;
                playerBody.velocity.z = 0;
                return;
            }

            const isTryingToMove = keyStates['KeyW'] || keyStates['KeyS'] || keyStates['KeyA'] || keyStates['KeyD'];
            const justLanded = !oldCanJump && canJump;

            if (justLanded) {
                wallJumpsAvailable = maxWallJumps;
            }

            if (keyStates['KeyC']) {
                if (!canJump) {
                    slideOnLand = true;
                } else {
                    const isSprinting = isSprintToggled && !isCrouching;
                    const shouldSlide = (isTryingToMove && isSprinting) || (justLanded && slideOnLand);

                    if (shouldSlide && !isSliding) {
                        isSliding = true;
                        isCrouching = true;
                        currentSlideSpeed = slideBoost;
                        playerBody.shapeOffsets[1].set(0, -0.35, 0);
                        lastSlideYPosition = playerBody.position.y;
                        slideHeightCheckTimer = 0;
                    } else if (!isTryingToMove && !isCrouching) {
                        isCrouching = true;
                        playerBody.shapeOffsets[1].set(0, -0.35, 0);
                    }
                }
            } else {
                slideOnLand = false;
                if (isCrouching) {
                    const start = playerBody.position;
                    const end = new CANNON.Vec3(start.x, start.y + (standingHeight - crouchingHeight) + 0.1, start.z);
                    const canStand = !world.raycastClosest(start, end, { skipBackfaces: true });
                    if (canStand) {
                        isCrouching = false;
                        isSliding = false;
                        playerBody.shapeOffsets[1].set(0, 0.35, 0);
                    }
                }
            }

            if (isSliding) {
                playerBody.velocity.y -= slideExtraGravity * delta;
                const verticalVelocity = playerBody.velocity.y;
                let slopeInfluence = 0;
                slideHeightCheckTimer += delta;
                if (slideHeightCheckTimer > slideHeightCheckInterval) {
                    const heightDifference = playerBody.position.y - lastSlideYPosition;
                    if (heightDifference < -0.05) slopeInfluence = Math.abs(heightDifference) / slideHeightCheckTimer * slideGravityFactor;
                    else if (heightDifference > 0.05) slopeInfluence = (heightDifference / slideHeightCheckTimer * slideGravityFactor) * -1.5;
                    lastSlideYPosition = playerBody.position.y;
                    slideHeightCheckTimer = 0;
                }
                currentSlideSpeed = (currentSlideSpeed * slideFriction) + slopeInfluence;
                currentSlideSpeed = Math.min(currentSlideSpeed, maxSlideSpeed);
                currentSlideSpeed = Math.max(0, currentSlideSpeed);
                const forward = new THREE.Vector3(0, 0, -1).applyQuaternion(camera.quaternion);
                forward.y = 0;
                forward.normalize();
                playerBody.velocity.x = forward.x * currentSlideSpeed;
                playerBody.velocity.z = forward.z * currentSlideSpeed;
                playerBody.velocity.y = verticalVelocity; 
                if (currentSlideSpeed < walkSpeed) {
                    isSliding = false;
                    if (isSprintToggled && isTryingToMove) {
                        const moveDir = new THREE.Vector3();
                        if (keyStates['KeyW']) moveDir.z = -1;
                        if (keyStates['KeyS']) moveDir.z = 1;
                        if (keyStates['KeyA']) moveDir.x = -1;
                        if (keyStates['KeyD']) moveDir.x = 1;
                        moveDir.normalize();
                        moveDir.multiplyScalar(sprintSpeed);
                        moveDir.applyQuaternion(camera.quaternion);
                        playerBody.velocity.x = moveDir.x;
                        playerBody.velocity.z = moveDir.z;
                    }
                }
            } else {
                const moveDirection = new THREE.Vector3();
                if (keyStates['KeyW']) moveDirection.z = -1;
                if (keyStates['KeyS']) moveDirection.z = 1;
                if (keyStates['KeyA']) moveDirection.x = -1;
                if (keyStates['KeyD']) moveDirection.x = 1;
                if (isTryingToMove) moveDirection.normalize();
                moveDirection.applyQuaternion(camera.quaternion);
                if (canJump) {
                    let targetSpeed = 0;
                    if (isTryingToMove) targetSpeed = isCrouching ? crouchSpeed : (isSprintToggled ? sprintSpeed : walkSpeed);
                    playerBody.velocity.x = moveDirection.x * targetSpeed;
                    playerBody.velocity.z = moveDirection.z * targetSpeed;
                } else {
                    const airControlForce = new CANNON.Vec3(moveDirection.x * airAcceleration * playerMass, 0, moveDirection.z * airAcceleration * playerMass);
                    playerBody.applyForce(airControlForce);
                    const horizontalSpeed = Math.sqrt(playerBody.velocity.x**2 + playerBody.velocity.z**2);
                    if (horizontalSpeed > sprintSpeed) {
                        const speedCapFactor = sprintSpeed / horizontalSpeed;
                        playerBody.velocity.x *= speedCapFactor;
                        playerBody.velocity.z *= speedCapFactor;
                    }
                }
            }

            const horizontalSpeed = Math.sqrt(playerBody.velocity.x**2 + playerBody.velocity.z**2);
            const shouldPlayFootsteps = canJump && !isSliding && horizontalSpeed > 1;

            if (shouldPlayFootsteps && !isMakingFootstepSounds) {
                isMakingFootstepSounds = true;
                scheduleNextFootstep(); 
            } else if (!shouldPlayFootsteps && isMakingFootstepSounds) {
                isMakingFootstepSounds = false;
                clearTimeout(footstepTimeout);
                footstepTimeout = null;
            }

            if (!isCcdBoosted) {
                const horizontalSpeed = Math.sqrt(playerBody.velocity.x**2 + playerBody.velocity.z**2);
                const speedRange = CCD_SPEED_MAX - CCD_SPEED_MIN;
                const iterationRange = MAX_CCD_ITERATIONS - MIN_CCD_ITERATIONS;

                let iterations = MIN_CCD_ITERATIONS;
                if (horizontalSpeed > CCD_SPEED_MIN) {
                    const speedFraction = Math.min((horizontalSpeed - CCD_SPEED_MIN) / speedRange, 1.0);
                    iterations += speedFraction * iterationRange;
                }
                
                playerBody.ccdIterations = Math.floor(Math.max(MIN_CCD_ITERATIONS, Math.min(iterations, MAX_CCD_ITERATIONS)));
            }
        }
        
        // ADDITION: Added missing function
        function updateSaferoomLighting() {
            if (saferoomGracePeriod) return;
            if (!saferoomBox || !flashlight) return;

            const playerPosition = new THREE.Vector3().copy(playerBody.position);
            const isInSaferoom = saferoomBox.containsPoint(playerPosition);

            if (isInSaferoom && !isCurrentlyInSaferoom) {
                enterSaferoom();
            }
        }

        function updateDoors(delta) {
            for (let i = doors.length - 1; i >= 0; i--) {
                const door = doors[i];
                if (!door || !door.mesh) continue;
                const playerPos = playerBody.position;
                if (door.type === 'wood') {
                    if (door.isBusted) {
                        if (door.body) {
                            door.mesh.position.copy(door.body.position);
                            door.mesh.quaternion.copy(door.body.quaternion);
                            if (door.body.position.y < DOOR_DESPAWN_Y) {
                                world.removeBody(door.body);
                                scene.remove(door.mesh);
                                doors.splice(i, 1);
                            }
                        }
                    } else {
                        const distance = door.mesh.position.distanceTo(new THREE.Vector3(playerPos.x, playerPos.y, playerPos.z));
                        if (distance < DOOR_BUST_DISTANCE) {
                            door.isBusted = true;
                            if (saferoomsCompleted > 0 && !Carnation) {
                                doorsOpenedThisLevel++;
                                logToScreen(`Doors opened this level: ${doorsOpenedThisLevel}`);
                                if (doorsOpenedThisLevel >= CarnationSpawnThreshold) {
                                    spawnCarnation(); 
                                }
                            }

                            playerBody.collisionFilterMask = -1 ^ DOOR_COLLISION_GROUP;
                            const doorSize = new THREE.Vector3();
                            new THREE.Box3().setFromObject(door.mesh).getSize(doorSize);
                            const halfExtents = new CANNON.Vec3(doorSize.x * 0.5, doorSize.y * 0.5, doorSize.z * 0.5);
                            const doorBody = new CANNON.Body({ mass: 35, shape: new CANNON.Box(halfExtents), position: new CANNON.Vec3().copy(door.mesh.position), quaternion: new CANNON.Quaternion().copy(door.mesh.quaternion), collisionFilterGroup: DOOR_COLLISION_GROUP, collisionFilterMask: 1 });
                            door.body = doorBody;
                            world.addBody(doorBody);
                            const playerSpeed = Math.sqrt(playerBody.velocity.x**2 + playerBody.velocity.z**2);
                            const totalForce = DOOR_BUST_FORCE + (playerSpeed * DOOR_SPEED_MULTIPLIER);
                            const directionFromPlayer = new CANNON.Vec3().copy(doorBody.position).vsub(playerPos);
                            directionFromPlayer.normalize(); 
                            const impulse = directionFromPlayer.scale(totalForce); 
                            const randomPoint = new CANNON.Vec3((Math.random() - 0.5) * doorSize.x * 0.5, (Math.random() - 0.5) * doorSize.y * 0.5, (Math.random() - 0.5) * doorSize.z * 0.5);
                            doorBody.applyImpulse(impulse, randomPoint); 
                        }
                    }
                } else if (door.type === 'metal') {
                    if (door.isOpening) {
                        door.animationProgress += delta * 0.4; 
                        door.animationProgress = Math.min(door.animationProgress, 1);

                        const easeInProgress = door.animationProgress * door.animationProgress;
                        
                        door.mesh.quaternion.slerp(door.targetRotation, easeInProgress);
                        door.mesh.position.lerp(door.targetPosition, easeInProgress);

                        if (door.animationProgress >= 1) {
                           door.isOpening = false;
                           if (!door.isOpen) {
                               door.isOpen = true;
                               startNextLevelTimer(); 
                               if (saferoomDoorBlocker) {
                                   world.removeBody(saferoomDoorBlocker);
                                   saferoomDoorBlocker = null;
                               }
                               const doorBody = doors.find(d => d.mesh === door.mesh)?.body;
                               if(doorBody){
                                   doorBody.collisionFilterGroup = 0;
                                   doorBody.collisionFilterMask = 0;
                               }
                           }
                       }
                    } else if (!door.isOpen) {
                        const distance = door.mesh.position.distanceTo(new THREE.Vector3(playerPos.x, playerPos.y, playerPos.z));
                        if (distance < 3.0) {
                            door.isOpening = true;
                            saferoomGracePeriod = true;
                            
                            // MODIFICATION: Select and play a random music track.
                            if (musicFadeInterval) clearInterval(musicFadeInterval); // Stop any ongoing fade
                            if (currentMusicTrack) {
                                currentMusicTrack.pause();
                                currentMusicTrack.currentTime = 0;
                                currentMusicTrack.volume = 0.3; // Reset volume from potential fade
                                currentMusicTrack.playbackRate = 1.0; // Reset playback rate
                            }
                            
                            // ADDITION: Cancel any existing GIF loop before starting a new song
                            if (ultrasonicFaithLoop) {
                                cancelAnimationFrame(ultrasonicFaithLoop);
                                ultrasonicFaithLoop = null;
                                hideAllGifs();
                            }

                            const randomTrackId = musicTracks[Math.floor(Math.random() * musicTracks.length)];
                            const music = document.getElementById(randomTrackId);
                            if (music) {
                                currentMusicTrack = music;
                                music.volume = 0.3; // Set initial volume
                                music.currentTime = 0.5; 
                                music.play().catch(e => logToScreen("Music play failed. User interaction may be needed.", true));
                                
                                // ADDITION: If it's the special song, start the GIF loop
                                if (randomTrackId === 'ULTRASONICFAITH') {
                                    startUltrasonicFaithLoop();
                                }
                            }

                            const doorBBox = new THREE.Box3().setFromObject(door.mesh);
                            const doorSize = doorBBox.getSize(new THREE.Vector3());
                            const forward = new THREE.Vector3(0, 0, -1).applyQuaternion(door.mesh.quaternion);
                            const initialPosition = door.mesh.position.clone();
                            const fallForwardOffset = forward.clone().multiplyScalar(doorSize.y * 0.5);
                            const fallDownOffset = new THREE.Vector3(0, -doorSize.y * 0.5 + doorSize.z * 0.5, 0); 
                            const userPositionOffset = METAL_DOOR_TUMBLE_POSITION_OFFSET.clone().applyQuaternion(door.mesh.quaternion);
                            door.targetPosition = initialPosition.add(fallForwardOffset).add(fallDownOffset).add(userPositionOffset);
                            const offsetQuat = new THREE.Quaternion().setFromEuler(METAL_DOOR_TUMBLE_ROTATION_OFFSET);
                            door.targetRotation = door.mesh.quaternion.clone().multiply(offsetQuat);
                            if (saferoomDoorBlocker) world.removeBody(saferoomDoorBlocker);
                            const blockerShape = new CANNON.Box(new CANNON.Vec3(doorSize.x * 0.5, doorSize.y * 0.5, 0.1));
                            saferoomDoorBlocker = new CANNON.Body({ mass: 0 });
                            saferoomDoorBlocker.addShape(blockerShape);
                            saferoomDoorBlocker.position.copy(door.mesh.position);
                            saferoomDoorBlocker.quaternion.copy(door.mesh.quaternion);
                            world.addBody(saferoomDoorBlocker);

                            const timerPanel = document.getElementById('timer-panel');
                            const fakeTimerPanel = document.getElementById('fake-timer-panel');
                            const initialTimeText = `${Math.floor(initialTime / 60)}:${(initialTime % 60).toString().padStart(2, '0')}.00`;

                            timerPanel.textContent = initialTimeText;
                            timerPanel.style.color = 'white';
                            timerPanel.style.display = 'block';

                            fakeTimerPanel.textContent = initialTimeText;
                            fakeTimerPanel.style.display = 'block';
                            fakeTimerPanel.style.animationPlayState = 'running';

                            saferoomBox = null;
                            exitSaferoom();
                            
                            const doorsToRemove = doors.filter(d => d.type === 'wood');

                            logToScreen("Generating next section...");
                            try {
                                doors.splice(0, doorsToRemove.length);
                                
                                const newPath = generateRandomPath(models, currentRoomCount, true);
                                scene.add(newPath);
                                newPath.updateMatrixWorld(true);
                                const newBodies = createStaticCollisionBodies(newPath);
                                
                                logToScreen("Cleaning up old sections...");
                                if (mapSegments.length > 1) {
                                    const oldestSegment = mapSegments.shift();
                                    for (const body of oldestSegment.physics) {
                                        world.removeBody(body);
                                    }
                                    scene.remove(oldestSegment.visual);
                                    logToScreen("Oldest saferoom segment removed.");
                                }

                                for (const d of doorsToRemove) {
                                    if (d.body) world.removeBody(d.body);
                                    scene.remove(d.mesh);
                                }
                                if (Carnation) {
                                    scene.remove(Carnation);
                                    Carnation = null;
                                }
                                CarnationPath = [];
                                CarnationPathIndex = 0;

                                mapSegments.push({ visual: newPath, physics: newBodies });

                            } catch (error) {
                                console.error(`Failed to generate next section: ${error.message}`);
                            }
                        }
                    }
                }
            }
        }

        // ADDITION: Added missing function
        function attemptWallJump() {
            let wallNormal = null;

            for (const contact of world.contacts) {
                let normal = new CANNON.Vec3();
                let isPlayerContact = false;

                if (contact.bi === playerBody) {
                    isPlayerContact = true;
                    contact.ni.negate(normal);
                } else if (contact.bj === playerBody) {
                    isPlayerContact = true;
                    normal.copy(contact.ni);
                }

                if (isPlayerContact) {
                    if (Math.abs(normal.y) < 0.7) { 
                        wallNormal = normal;
                        break;
                    }
                }
            }

            if (wallNormal) {
                wallJumpsAvailable--;
                logToScreen(`Wall jump! ${wallJumpsAvailable} remaining.`);
                triggerCameraShake(WALL_JUMP_SHAKE_INTENSITY, WALL_JUMP_SHAKE_DURATION);
                
                const forwardDirection = new THREE.Vector3(0, 0, -1);
                forwardDirection.applyQuaternion(camera.quaternion);
                forwardDirection.y = 0;
                forwardDirection.normalize();

                playerBody.velocity.y = 0;

                const verticalImpulse = new CANNON.Vec3(0, wallJumpUpwardVelocity * playerMass, 0);
                const wallPushImpulse = new CANNON.Vec3();
                wallNormal.scale(wallJumpForce * playerMass, wallPushImpulse);
                
                const forwardImpulse = new CANNON.Vec3(
                    forwardDirection.x * wallJumpForce * wallJumpForwardMultiplier * playerMass,
                    0,
                    forwardDirection.z * wallJumpForce * wallJumpForwardMultiplier * playerMass
                );

                playerBody.applyImpulse(verticalImpulse);
                playerBody.applyImpulse(wallPushImpulse);
                playerBody.applyImpulse(forwardImpulse);
            }
        }

        // ADDITION: Added missing function
        function updateWallJumpVisualizer() {
            if (!wallContactDebugArrow) return;

            if (canJump || wallJumpsAvailable <= 0) {
                wallContactDebugArrow.visible = false;
                return;
            }

            let wallNormal = null;
            for (const contact of world.contacts) {
                let normal = new CANNON.Vec3();
                let isPlayerContact = false;

                if (contact.bi === playerBody) {
                    isPlayerContact = true;
                    contact.ni.negate(normal);
                } else if (contact.bj === playerBody) {
                    isPlayerContact = true;
                    normal.copy(contact.ni);
                }

                if (isPlayerContact) {
                    if (Math.abs(normal.y) < 0.7) { 
                        wallNormal = normal;
                        break;
                    }
                }
            }

            if (wallNormal) {
                wallContactDebugArrow.visible = true;
                wallContactDebugArrow.position.copy(playerBody.position);
                wallContactDebugArrow.setDirection(new THREE.Vector3().copy(wallNormal));
            } else {
                wallContactDebugArrow.visible = false;
            }
        }


        // ADDITION: New functions to handle the GIF overlay system
        function hideAllGifs() {
            document.querySelectorAll('.music-gif').forEach(gif => {
                gif.style.display = 'none';
            });
        }

        function ultrasonicFaithTimeUpdate() {
            if (!currentMusicTrack || currentMusicTrack.id !== 'ULTRASONICFAITH' || currentMusicTrack.paused || isPlayerDead) {
                ultrasonicFaithLoop = null;
                hideAllGifs();
                return;
            }

            const currentTime = currentMusicTrack.currentTime;

            while (nextGifEventIndex < ultrasonicFaithSchedule.length && currentTime >= ultrasonicFaithSchedule[nextGifEventIndex].time) {
                const event = ultrasonicFaithSchedule[nextGifEventIndex];
                event.targets.forEach(targetId => {
                    const gifElement = document.getElementById(targetId);
                    if (gifElement) {
                        if (event.action === 'show') {
                            gifElement.style.display = 'block';
                            // Reset GIF animation by re-setting its src
                            const src = gifElement.src;
                            gifElement.src = '';
                            gifElement.src = src;
                        } else {
                            gifElement.style.display = 'none';
                        }
                    }
                });
                nextGifEventIndex++;
            }

            ultrasonicFaithLoop = requestAnimationFrame(ultrasonicFaithTimeUpdate);
        }

        function startUltrasonicFaithLoop() {
            nextGifEventIndex = 0;
            hideAllGifs();
            if (ultrasonicFaithLoop) {
                cancelAnimationFrame(ultrasonicFaithLoop);
            }
            ultrasonicFaithLoop = requestAnimationFrame(ultrasonicFaithTimeUpdate);
        }

        // ADDITION: New function to update the wind sound based on player speed
        function updateWindSound() {
            if (!windSound || isPlayerDead) return;

            const MIN_SPEED_FOR_WIND = 20; // Roughly walk speed
            const MAX_SPEED_FOR_WIND = 70; // A bit above max slide speed
            const MAX_WIND_VOLUME = 0.4;

            const horizontalSpeed = Math.sqrt(playerBody.velocity.x**2 + playerBody.velocity.z**2);

            let targetVolume = 0;
            if (horizontalSpeed > MIN_SPEED_FOR_WIND) {
                const speedRatio = (horizontalSpeed - MIN_SPEED_FOR_WIND) / (MAX_SPEED_FOR_WIND - MIN_SPEED_FOR_WIND);
                targetVolume = Math.min(speedRatio, 1.0) * MAX_WIND_VOLUME;
            }
            
            // Smoothly interpolate to the target volume to avoid sudden changes
            windSound.volume += (targetVolume - windSound.volume) * 0.1;

            // ADDITION: Manually loop the first 3 seconds of the wind sound to prevent cutting off.
            if (windSound.currentTime >= 3) {
                windSound.currentTime = 0;
            }
        }

        // ADDITION: New function to update the Carnation's proximity sound
        function updateCarnationSound() {
            if (!Carnation || !carnationLoopSound) {
                return;
            }

            const maxDistance = 100;
            const minDistance = 2;
            const maxVolume = 1.0; // Max volume when very close

            const distance = playerBody.position.distanceTo(Carnation.position);
            
            if (distance < maxDistance) {
                // Use a power curve (Math.pow with exponent > 1) so volume ramps up faster when closer
                const closeness = 1 - ((distance - minDistance) / (maxDistance - minDistance));
                const volume = Math.pow(Math.max(0, Math.min(closeness, 1)), 2) * maxVolume;
                carnationLoopSound.volume = volume;
            } else {
                carnationLoopSound.volume = 0;
            }
        }

        // MODIFICATION: Rewritten wind streak logic for world-space positioning
        function updateWindStreaks(delta) {
            if (!windStreaks || isPlayerDead) {
                if (windStreaks) windStreaks.material.opacity = 0;
                return;
            }

            const totalSpeed = playerBody.velocity.length();
            const MIN_SPEED_FOR_STREAKS = 10;
            const MAX_SPEED_FOR_STREAKS = 40;
            const MAX_STREAK_OPACITY = 0.6;

            let targetOpacity = 0;
            if (totalSpeed > MIN_SPEED_FOR_STREAKS) {
                const speedRatio = (totalSpeed - MIN_SPEED_FOR_STREAKS) / (MAX_SPEED_FOR_STREAKS - MIN_SPEED_FOR_STREAKS);
                targetOpacity = Math.min(speedRatio, 1.0) * MAX_STREAK_OPACITY;
            }

            windStreaks.material.opacity += (targetOpacity - windStreaks.material.opacity) * 0.1;

            if (windStreaks.material.opacity <= 0) return;

            // The wind should flow in the opposite direction of the player's world velocity
            const windFlow = new THREE.Vector3(-playerBody.velocity.x, -playerBody.velocity.y, -playerBody.velocity.z);

            // The entire particle system's origin follows the player
            windStreaks.position.copy(playerBody.position);

            const positions = windStreaks.geometry.attributes.position.array;
            const moveStep = windFlow.clone().multiplyScalar(delta);
            const normalizedWind = windFlow.clone().normalize();
            
            for (let i = 0; i < positions.length; i += 6) {
                // Move particle start points relative to the moving particle system
                positions[i + 0] += moveStep.x;
                positions[i + 1] += moveStep.y;
                positions[i + 2] += moveStep.z;

                // Reset logic: If a particle gets too far from the player (the system's origin)
                const posVec = new THREE.Vector3(positions[i], positions[i + 1], positions[i + 2]);
                if (posVec.length() > 50) { // MODIFICATION: Tighter reset distance
                    // Respawn in a volume in front of the player's current direction of movement
                    const spawnPos = normalizedWind.clone().negate().multiplyScalar(THREE.MathUtils.randFloat(3, 30));
                    
                    // Add some random spread to the spawn point
                    spawnPos.x += THREE.MathUtils.randFloatSpread(4); // MODIFICATION: Much tighter spread
                    spawnPos.y += THREE.MathUtils.randFloatSpread(2.5); // MODIFICATION: Much tighter spread
                    spawnPos.z += THREE.MathUtils.randFloatSpread(4); // MODIFICATION: Much tighter spread

                    positions[i + 0] = spawnPos.x;
                    positions[i + 1] = spawnPos.y;
                    positions[i + 2] = spawnPos.z;
                }

                // The "end" of the streak always trails behind the start point, aligned with the wind direction
                const streakLength = THREE.MathUtils.randFloat(1, 4) * (totalSpeed / MAX_SPEED_FOR_STREAKS);
                positions[i + 3] = positions[i + 0] - normalizedWind.x * streakLength;
                positions[i + 4] = positions[i + 1] - normalizedWind.y * streakLength;
                positions[i + 5] = positions[i + 2] - normalizedWind.z * streakLength;
            }
            windStreaks.geometry.attributes.position.needsUpdate = true;
        }

        // ADDITION: New function to adjust music volume based on Carnation's proximity
        function updateMusicVolume() {
            // Don't interfere if the music is already fading out or not playing
            if (!currentMusicTrack || isPlayerDead || isCurrentlyInSaferoom || musicFadeInterval) {
                return;
            }

            const DUCK_DISTANCE = 120;
            const BASE_VOLUME = 0.3;
            const DUCKED_VOLUME = BASE_VOLUME * 0.25; // Reduced to 1/4 of original volume

            let targetVolume = BASE_VOLUME;

            if (Carnation) {
                const distance = playerBody.position.distanceTo(Carnation.position);
                if (distance < DUCK_DISTANCE) {
                    targetVolume = DUCKED_VOLUME;
                }
            }
            
            // Smoothly interpolate to the target volume to avoid sudden changes
            currentMusicTrack.volume += (targetVolume - currentMusicTrack.volume) * 0.05;
        }

        // ADDITION: New function to update the Carnation warning text
        function updateCarnationWarning() {
            const warningText = document.getElementById('carnation-warning-text');
            if (!warningText) return;

            const WARNING_DISTANCE = 50;
            const SHAKE_INTENSITY = 25; // Pixels for the snappy shake

            if (Carnation) {
                const distance = playerBody.position.distanceTo(Carnation.position);

                if (distance < WARNING_DISTANCE) {
                    warningText.style.display = 'block';

                    // MODIFICATION: Handle blinking in JavaScript for more control
                    // This toggles opacity between 0 and 0.5 every 50ms (2x faster)
                    warningText.style.opacity = (Math.floor(Date.now() / 50) % 2 === 0) ? '0.5' : '0';

                    // Apply a rapid, snappy shake
                    const shakeX = (Math.random() - 0.5) * SHAKE_INTENSITY;
                    const shakeY = (Math.random() - 0.5) * SHAKE_INTENSITY;
                    warningText.style.transform = `translate(calc(-50% + ${shakeX}px), calc(-50% + ${shakeY}px))`;

                } else {
                    // Hide the warning if Carnation is too far
                    warningText.style.display = 'none';
                }
            } else {
                // Hide the warning if Carnation is not active
                warningText.style.display = 'none';
            }
        }
        
        // ADDITION: New function to update the wall jump indicator UI
        function updateWallJumpIndicator() {
            const indicator = document.getElementById('walljump-indicator');
            if (!indicator) return;

            // Hide the indicator if wall jumps are full or if the player is grounded.
            if (wallJumpsAvailable === maxWallJumps || canJump) {
                indicator.style.display = 'none';
                return;
            }
            
            indicator.style.display = 'block';

            const jumpsUsed = maxWallJumps - wallJumpsAvailable;
            switch(jumpsUsed) {
                case 1:
                    indicator.textContent = 'I';
                    indicator.style.opacity = '1';
                    break;
                case 2:
                    indicator.textContent = 'II';
                    indicator.style.opacity = '1';
                    break;
                case 3:
                    indicator.textContent = 'III';
                    indicator.style.opacity = '0.5';
                    break;
                default:
                    indicator.style.display = 'none';
            }
        }

        // ADDITION: New function to update the vignette effect
        function updateVignette() {
            const vignette = document.getElementById('vignette-overlay');
            if (!vignette) return;
            
            const VIGNETTE_MAX_DISTANCE = 300;
            const VIGNETTE_MIN_DISTANCE = 6; // Match the kill distance for max effect

            if (Carnation) {
                const distance = playerBody.position.distanceTo(Carnation.position);

                if (distance < VIGNETTE_MAX_DISTANCE) {
                    // This calculates "closeness" as a value from 0 to 1.
                    const closeness = 1 - ((distance - VIGNETTE_MIN_DISTANCE) / (VIGNETTE_MAX_DISTANCE - VIGNETTE_MIN_DISTANCE));
                    
                    // MODIFICATION: Use Math.pow to create a curve where the effect is more intense at closer ranges.
                    // A power less than 1 makes the vignette appear stronger, sooner.
                    const opacity = Math.pow(Math.max(0, Math.min(closeness, 1)), 0.75);
                    
                    vignette.style.opacity = opacity;
                } else {
                    vignette.style.opacity = 0; // Fade out if further than 300
                }
            } else {
                vignette.style.opacity = 0; // Fade out if Carnation is not active
            }
        }

        // ADDITION: New function to keep the sky plane oriented to the camera
        function updateSkyPlane() {
            if (!skyPlane) return;

            // MODIFICATION: Plane now follows the player's X/Z position but stays flat like a ceiling.
            skyPlane.position.x = playerBody.position.x;
            skyPlane.position.y = playerBody.position.y + 50; // Fixed height above the player
            skyPlane.position.z = playerBody.position.z;
            
            // Always face straight down, parallel to the ground.
            skyPlane.rotation.x = Math.PI / 2;
            skyPlane.rotation.y = 0;
            skyPlane.rotation.z = 0;

            // ADDITION: Explicitly tell Three.js to update the texture every frame.
            if (skyVideoTexture) {
                skyVideoTexture.needsUpdate = true;
            }

            // Update the debug wireframe
            if (skyPlaneWireframe) {
                skyPlaneWireframe.update();
            }
        }

        function updateCameraFOV() {
            const speed = playerBody.velocity.length(); 
            const baseFOV = 75;  
            const maxFOV  = 120; 
            const maxSpeed = 40; 
        
            let targetFOV = baseFOV + (maxFOV - baseFOV) * (speed / maxSpeed);
        
            targetFOV = Math.min(Math.max(targetFOV, baseFOV), maxFOV);
        
            camera.fov += (targetFOV - camera.fov) * 0.1;
            camera.updateProjectionMatrix();
        }

        function updateDoorVisibility() {
            const cameraPosition = camera.position;

            for (const door of doors) {
                if(door.mesh) {
                    const distanceToDoor = cameraPosition.distanceTo(door.mesh.position);
                    door.mesh.visible = distanceToDoor <= DOOR_RENDER_DISTANCE;
                }
            }
        }

        function updateCarnation(delta) {
            if (!Carnation || CarnationPath.length === 0) return;

            if (CarnationPathIndex >= CarnationPath.length) {
                logToScreen("Carnation reached the end and disappeared.");
                if (carnationLoopSound) carnationLoopSound.pause(); // Stop the sound
                scene.remove(Carnation);
                Carnation = null;
                CarnationPath = [];
                return;
            }

            const targetPosition = CarnationPath[CarnationPathIndex];
            const distanceToTarget = Carnation.position.distanceTo(targetPosition);
            
            // --- MODIFICATION: Dynamic Speed Logic ---
            const distanceToPlayer = Carnation.position.distanceTo(playerBody.position);
            
            // Define how much faster Carnation gets with distance.
            // A factor of 0.2 means it gets 20% faster for every 50 units of distance.
            const speedBonusFactor = 0.2; 
            const distanceUnitForBonus = 100;
            
            // Calculate the speed bonus and the new dynamic speed. The base speed is the minimum.
            const speedBonus = (distanceToPlayer / distanceUnitForBonus) * Carnation_MOVE_SPEED * speedBonusFactor;
            const currentDynamicSpeed = Carnation_MOVE_SPEED + speedBonus;
            
            const moveDistance = currentDynamicSpeed * delta;

            Carnation.lookAt(targetPosition);

            if (distanceToTarget < moveDistance) {
                Carnation.position.copy(targetPosition);
                CarnationPathIndex++;
            } else {
                const direction = new THREE.Vector3().subVectors(targetPosition, Carnation.position).normalize();
                Carnation.position.add(direction.multiplyScalar(moveDistance));
            }
        }
      
        function updateCarnationShake() {
            if (!Carnation) {
                proximityShakeIntensity = 0;
                return;
            }
            const distance = playerBody.position.distanceTo(Carnation.position);
            if (distance < Carnation_SHAKE_MAX_DISTANCE) {
                const closeness = 1 - (Math.max(0, distance - Carnation_SHAKE_MIN_DISTANCE) / (Carnation_SHAKE_MAX_DISTANCE - Carnation_SHAKE_MIN_DISTANCE));
                proximityShakeIntensity = Carnation_SHAKE_MAX_INTENSITY * closeness;
            } else {
                proximityShakeIntensity = 0;
            }
        }
        
        function updateCarnationDistanceTracker() {
            const tracker = document.getElementById('Carnation-distance-tracker');
            if (Carnation) {
                const distance = playerBody.position.distanceTo(Carnation.position);
                tracker.textContent = `Carnation Distance: ${distance.toFixed(1)}m`;

                // ADDITION: Kill mechanic when Carnation is too close
                if (distance < 6) {
                    playerDeath("You were caught by Carnation!");
                }
            } else {
                tracker.textContent = 'Carnation Distance: N/A';
            }
        }

        function animate() {
            if (isPlayerDead) return; // Stop the animation loop on death
            requestAnimationFrame(animate);
            const delta = Math.min(clock.getDelta(), 0.1);

            world.step(1/60, delta); 
            oldCanJump = canJump;
            updateGroundedState();
            updateSaferoomLighting();
            updateDoors(delta);
            updateWallJumpVisualizer();
            updateDoorVisibility(); 
            updateCarnation(delta);
            updateCarnationShake();
            updateCarnationDistanceTracker();
            updateVignette();
            updateCarnationSound();
            updateWindSound();
            updateWindStreaks(delta);
            updateWallJumpIndicator();
            updateCarnationWarning();
            updateMusicVolume();
            updateSkyPlane();

            if (controls.isLocked) {
                 updatePlayer(delta);
            }
           
            const targetHeight = isCrouching ? crouchingHeight : standingHeight;
            playerHeight = THREE.MathUtils.lerp(playerHeight, targetHeight, 0.15);
            
            const baseCameraPosition = new THREE.Vector3().copy(playerBody.position);
            baseCameraPosition.y += playerHeight * 0.4;
            
            // Set base camera position before applying any shakes
            camera.position.copy(baseCameraPosition);

            // --- MODIFICATION: Refactored shake logic to apply to UI ---
            let totalShakeX = 0;
            let totalShakeY = 0;

            // --- SPRINT SHAKE ---
            const isSprintingOnGround = isSprintToggled && canJump && !isSliding;
            const bodySpeed = Math.sqrt(playerBody.velocity.x ** 2 + playerBody.velocity.z ** 2);
            if (isSprintingOnGround && bodySpeed > walkSpeed + 1) {
                shakeTime += delta;
                totalShakeX += Math.sin(shakeTime * shakeSpeed) * shakeIntensity;
                totalShakeY += Math.abs(Math.sin(shakeTime * shakeSpeed * 0.7)) * shakeIntensity;
            } else {
                shakeTime = 0; // Reset shake time if not sprinting
            }

            // --- EVENT/PROXIMITY SHAKE ---
            if (eventShakeDuration > 0) {
                eventShakeDuration -= delta;
                if (eventShakeDuration <= 0) {
                    eventShakeIntensity = 0;
                }
            }
            const totalEventShake = Math.max(eventShakeIntensity, proximityShakeIntensity);
            if (totalEventShake > 0) {
                const eventShakeTime = clock.getElapsedTime();
                totalShakeX += Math.sin(eventShakeTime * 50) * totalEventShake;
                totalShakeY += Math.cos(eventShakeTime * 45) * totalEventShake;
            }

            // Apply shake to camera
            camera.position.x += totalShakeX;
            camera.position.y += totalShakeY;
            
            // MODIFICATION: Apply shake and smooth camera follow to the flashlight's target
            if (flashlight.visible) {
                // 1. Calculate the ideal target position in world space (directly in front of the camera)
                const idealTargetPos = new THREE.Vector3(0, 0, -10); // 10 units in front
                idealTargetPos.applyMatrix4(camera.matrixWorld);

                // 2. Add the calculated shake effect to this ideal position
                const flashlightShakeMultiplier = 0.8; 
                idealTargetPos.x += totalShakeX * flashlightShakeMultiplier;
                idealTargetPos.y += totalShakeY * flashlightShakeMultiplier;
                
                // 3. Smoothly interpolate the flashlight's actual target towards the ideal position.
                // The second argument (0.2) controls the smoothing speed. Higher is faster.
                flashlight.target.position.lerp(idealTargetPos, 0.2);
                
                // 4. Important: We need to tell the light to update after moving its target
                flashlight.target.updateMatrixWorld();
            }

            // Apply shake to UI timer panels
            const timerPanel = document.getElementById('timer-panel');
            const fakeTimerPanel = document.getElementById('fake-timer-panel');
            if (timerPanel && fakeTimerPanel) {
                const uiShakeMultiplier = 30; // Makes the UI shake more visibly
                const transformString = `translate(${totalShakeX * uiShakeMultiplier}px, ${-totalShakeY * uiShakeMultiplier}px)`;
                timerPanel.style.transform = transformString;
                fakeTimerPanel.style.transform = transformString;
            }


            const pos = playerBody.position;
            document.getElementById('coords-panel').textContent = `X: ${pos.x.toFixed(2)} | Y: ${pos.y.toFixed(2)} | Z: ${pos.z.toFixed(2)}`;

            updateCameraFOV();
        
            renderer.render(scene, camera);
        }
        
        init();
    </script>
